import React from 'react'
import Li from './li'
import Atag from './atag'
import Img from './img'

const Ul = (props) => {
    return (
        <ul className={props.className}>
            <Li className={'ml-5'} text={<Atag link={'#about'} text={'About'}/>} />
            <Li className={'ml-5'} text={<Atag link={'#works'} text={'Works'}/>} />
            <Li className={'ml-5'} text={<Atag link={'#news'} text={'News'}/>} />
            <Li className={'ml-5'} text={<Atag link={'#contact'} text={'Contact'}/>} />
            <Li className={'ml-5'} text={<Atag link={'#contact'} text={<Img className={'h-5 w-5'} src={'./icon-instagram.png'}/>}/>} />
        </ul>
    );
}

export default Ul
